import React from 'react';
import classes from './Users.module.css';

const Users = ({ users, unfollow, setUsers, follow }) => {
    if( users.length === 0){
        setUsers([
            { id: 1, photoUrl: 'data:image/png;base64,', followed: false, fullName: 'Nazar', status: 'husbant', location: { city: 'Kalush', country: 'Ukraine' } },
            { id: 2, photoUrl: 'data:image/png;base64,', followed: false, fullName: 'Switlana', status: 'wife', location: { city: 'Humeniw', country: 'Ukraine' } },
            { id: 3, photoUrl: 'data:image/png;base64,', followed: true, fullName: 'Angelina', status: 'daughter', location: { city: 'Humeniw', country: 'Ukraine' } },
            { id: 4, photoUrl: 'data:image/png;base64,', followed: true, fullName: 'Witalik', status: 'Kum', location: { city: 'Kalush', country: 'Ukraine' } },
        ] 
        )
    }
    return (
        <div>
            {
                users.map(u => <div key={u.id}>
                    <div>
                        <div>
                            <img src={u.photoUrl} className={classes.userPhoto} />
                        </div>
                        <div>
                            {u.followed 
                            ? <button onClick={() => {follow(u.id)} }>Follow</button>
                                : <button onClick={() => {unfollow(u.id)} }>unFollow</button>}
                        </div>
                    </div>

                    <div>
                        <div>
                            <div>{u.fullName}</div>
                            <div>{u.status}</div>
                        </div>
                        <div>
                            <div>{u.location.city}</div>
                            <div>{u.location.country}</div>
                        </div>
                    </div>
                </div>)

            }
        </div>
    )






}
export default Users;